import * as React from 'react';
import Header from "./Header";
import Map from "./Map";
import {Category} from "./Category";
import {SearchInput} from "./SearchInput";

const Main = () => {
    return (
        <>
            <Header/>
            <SearchInput/>
            <Category title={"오늘의 추천 메뉴"}/>
            <Map/>
        </>
    );
};

export default Main;
